#!/usr/bin/env python
# -*- coding: utf-8 -*-
import unittest

from container_decrypter.dlc import DLC

dlcstr = ''


class TestDLC(unittest.TestCase):
    def setUp(self):
        self.dlc = DLC()

    def test_decrypt(self):
        result = self.dlc.decrypt(dlcstr)
        self.assertIsNotNone(result)

    def test_empty_dlc(self):
        self.assertIsNone(self.dlc.decrypt(''))

    def test_invalid_dlc(self):
        self.assertIsNone(self.dlc.decrypt(dlcstr[-1]))


if __name__ == '__main__':
    unittest.main()
